import React from "react";
import { Button } from "react-bootstrap";
import { Link } from "react-router-dom";
import { HomeContainer, H1Text, H2Text, DivSingleContainer, Img, InsideDivSingleContainer } from "./Home.css";
import { HomeData } from "./HomeData";

const Home = () => {
    return (
        <HomeContainer>
            {HomeData.map((item) =>
                <DivSingleContainer>
                    <InsideDivSingleContainer>
                        <H1Text>{item.textH1}</H1Text>
                        <H2Text>{item.textH2}</H2Text>
                        <Link to={item.path}><Btn variant="success">{item.buttonText}</Btn></Link>
                    </InsideDivSingleContainer>
                    <InsideDivSingleContainer>
                        <Img src={item.img}/>
                    </InsideDivSingleContainer>
                </DivSingleContainer>
            )}
        </HomeContainer>

    )
}


export default Home;
